INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (3, "", 1, 1, 6000, 2, "---", "アサヒ", "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 0);
INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (0, "ホームランを連発すると、連発数に応じてパワーアップする", 1, 3, 16000, 3, "アドレナリン", "部員3", "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3);
INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (2, "幸運のハプニングを呼び込む", 1, 2, 30000, 4, "ラッキー", "{0}", "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2);
